import React from 'react'
import {Redirect, useHistory} from "react-router-dom";

const MyCart = () => {
    let history=useHistory();
    const token=localStorage.getItem("token")
    if(token==null)
    {
       
        history.push({
            pathname:'/signin'
        })
    }
    return (
        <div className="cart">
            <h1>MY CART</h1>
        </div>
    )
}

export default MyCart
